    <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
          {direccion}
        </Card.Text>
        <Button variant="outline-dark">Go somewhere</Button>
    </Card.Body>
    </Card>
  );
  }
}

export default Propiedad;
